import { BrowserRouter as Router, Route, Routes, Navigate } from "react-router-dom";
import { createContext, useState, useContext } from "react";
import axios from "axios";
import "tailwindcss/tailwind.css";

const AuthContext = createContext();

const AuthProvider = ({ children }) => {
  const [user, setUser] = useState(null);

  const login = async (email, password) => {
    try {
      const response = await axios.post("http://localhost:8000/auth/login", { email, password });
      setUser(response.data);
    } catch (error) {
      console.error("Login failed", error);
    }
  };

  const register = async (email, password) => {
    try {
      await axios.post("http://localhost:8000/auth/register", { email, password });
      await login(email, password);
    } catch (error) {
      console.error("Registration failed", error);
    }
  };

  const logout = () => setUser(null);

  return (
    <AuthContext.Provider value={{ user, login, register, logout }}>
      {children}
    </AuthContext.Provider>
  );
};

const useAuth = () => useContext(AuthContext);

const Login = () => {
  const { login } = useAuth();
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gray-100">
      <h2 className="text-2xl mb-4">Login</h2>
      <input className="p-2 border mb-2" placeholder="Email" onChange={(e) => setEmail(e.target.value)} />
      <input className="p-2 border mb-2" type="password" placeholder="Password" onChange={(e) => setPassword(e.target.value)} />
      <button className="bg-blue-500 text-white p-2" onClick={() => login(email, password)}>Login</button>
    </div>
  );
};

const Register = () => {
  const { register } = useAuth();
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gray-100">
      <h2 className="text-2xl mb-4">Register</h2>
      <input className="p-2 border mb-2" placeholder="Email" onChange={(e) => setEmail(e.target.value)} />
      <input className="p-2 border mb-2" type="password" placeholder="Password" onChange={(e) => setPassword(e.target.value)} />
      <button className="bg-green-500 text-white p-2" onClick={() => register(email, password)}>Register</button>
    </div>
  );
};

const Dashboard = () => {
  const { user, logout } = useAuth();
  if (!user) return <Navigate to="/login" />;
  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gray-100">
      <h2 className="text-2xl mb-4">Welcome, {user.email}!</h2>
      <button className="bg-red-500 text-white p-2" onClick={logout}>Logout</button>
    </div>
  );
};

const App = () => {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="*" element={<Navigate to="/login" />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
};

export default App;
